package com.qtz.sm.shopManage.page;import com.mall.core.vo.Pager;/** * <p>Title:ShopManageStaffPage</p> * <p>Description:便利店管理员工分页类</p> * <p>Copyright: Copyright (c) 2016</p> * <p>Company: 深圳擎天柱信息技术有限公司</p> * @author 刘晓峰 - Laven * @version v1.0 2016-04-26 */public class ShopManageStaffPage extends Pager<com.qtz.sm.shopManage.vo.ShopManageStaff,Long> implements java.io.Serializable{	/**类的版本号*/	private static final long serialVersionUID = 1636495968880641L;		/** 主键ID */	private Long dmId;	/** 所属便利店管理公司ID */	private Long shopManageId;	/** 员工名称 */	private String name;	/** 密码 */	private String pwd;	/** 手机号 */	private String phone;	/** 状态:0正常,1离职 */	private Integer status;	public Long getDmId() {	    return this.dmId;	}	public void setDmId(Long dmId) {	    this.dmId=dmId;	}	public Long getShopManageId() {	    return this.shopManageId;	}	public void setShopManageId(Long shopManageId) {	    this.shopManageId=shopManageId;	}	public String getName() {	    return this.name;	}	public void setName(String name) {	    this.name=name;	}	public String getPwd() {	    return this.pwd;	}	public void setPwd(String pwd) {	    this.pwd=pwd;	}	public String getPhone() {	    return this.phone;	}	public void setPhone(String phone) {	    this.phone=phone;	}	public Integer getStatus() {	    return this.status;	}	public void setStatus(Integer status) {	    this.status=status;	}	public String toString() {	    return "[" + "dmId:" + getDmId() +"," + "shopManageId:" + getShopManageId() +"," + "name:" + getName() +"," + "pwd:" + getPwd() +"," + "phone:" + getPhone() +"," + "status:" + getStatus() +"]";	}}